export const SUBMIT_FORM = 'SUBMIT_FORM';
export const CLEAN_FORM = 'CLEAN_FORM';

export const submitForm = (payload) => ({
  type: SUBMIT_FORM,
  payload,
});

export const cleanForm = (payload) => ({
  type: CLEAN_FORM,
});
